import { createIcon } from "../icon/createIcon";

export const ImportSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ImportSolidIcon">
    <path d="M4.999 6.98 5 9l4-3.015L5 3l-.001 1.99H0V0h12v12H0V6.98h4.999zM11 1H7v1h3v8H7v1h4V1z" />
  </svg>,
  "ImportSolid",
  "import solid"
);
